      Space Racers - -

      Roll a d100, that is the speed limit. Take turns increasing your speed as close to the number as possible, using a d20 or d6 on your turn.

      Going over the limit means you're busted.

      In the event of a tie, the one who rolled the least wins.

      If you bust early, place bets on who'll win, the fun only stops when you do!
    type: Paper
  - canCollide: False
    type: Physics
